function Navbar({ scrollTo, refs }) {
  return (
    <nav className="navbar">
      <h2>SmileCare</h2>
      <div>
        <button onClick={() => scrollTo(refs.homeRef)}>Home</button>
        <button onClick={() => scrollTo(refs.servicesRef)}>Services</button>
        <button onClick={() => scrollTo(refs.appointmentRef)}>Appointment</button>
        <button onClick={() => scrollTo(refs.timingsRef)}>Timings</button>
        <button onClick={() => scrollTo(refs.locationRef)}>Location</button>
      </div>
    </nav>
  );
}

export default Navbar;
